function acoplarserie(ser, lon) {

    var salida, l;

    if (ser.length >= lon) {
        salida = ser.substring(0, lon);
    } else {
        l = ser.length;
        salida = ser;
        for (var i = l + 1; i <= lon; i++) {
            salida = salida + ' ';
        }
    }

    return salida;

}

function acoplarseriemax(ser, lon) {

    var salida;

    if (ser.length >= lon) {
        salida = ser.substring(0, lon);
    } else {
        salida = ser;
    }

    return salida;

}

